import React from 'react';
import './App.scss';

import CircleBackground from './widgets/CircleBackground/CircleBackground'
import Card from './widgets/Card/Card'

import {ColumnContainer, ColumnContainerExtended, RowContainerExtended} from './widgets/FlexShorthand/FlexShorthand'


class App extends React.Component {


  render() {
    return (
      <div className="App Container" >
      <CircleBackground/>
      <ColumnContainerExtended className="App-header">

          <Card style = {{flexGrow:1}}>
            Fetch orginal requests
          </Card>
          <div>Test</div>

          <Card>
            Robot Control Panel
          </Card>

        </ColumnContainerExtended>
      </div>
    )
  }

}

export default App;
